const VENUE = 'venue';
const AGENT = 'agent';

const SUSCEPTIBLE = 0;
const SICK = 1;
const RECOVERED = 2;
const DEAD = 3;

const COLORS = ['#ECA6E1','#C28CBE','#9B729C','#76597B','#55415B','#362A3C'];
const FPS = 400;

export {
  SUSCEPTIBLE, SICK, RECOVERED, DEAD,
  VENUE, AGENT,
  COLORS,
  FPS,
};
